/* Sporting_Goods.sql */
-- Create Customer table
CREATE TABLE Customer
(CustomerID INTEGER,
Company VARCHAR(100),
LastName VARCHAR(50),
FirstName VARCHAR(50),  
Age INTEGER,
Gender CHAR(1),
Type CHAR(1),
Address VARCHAR(100),
City VARCHAR(50),
State CHAR(2),
ZipCode CHAR(5),
Phone CHAR(10),
CreditCard VARCHAR(30),
CreditCardNumber CHAR(16),
ExpirationDate DATE,
CONSTRAINT PKCustomer PRIMARY KEY (CustomerID)
);

-- Create Employee table
CREATE TABLE Employee
(EmployeeID INTEGER,
LastName VARCHAR(50),
FirstName VARCHAR(50),
Address VARCHAR(100),
City VARCHAR(50),
State CHAR(2),
ZipCode CHAR(5),
Phone CHAR(10),
Supervisor INTEGER,
HireDate DATE,
EmpRank CHAR(1),
Salary DOUBLE,
CONSTRAINT PKEmployee PRIMARY KEY (EmployeeID)
);

-- Create Product table
CREATE TABLE Product
(ProductID INTEGER,
ProdName VARCHAR(50),
ProdGroup VARCHAR(30),
ProdType VARCHAR(30),
WholesalePrice DOUBLE,
RetailPrice DOUBLE,
OnHand DOUBLE,
CONSTRAINT PKProduct PRIMARY KEY (ProductID),
CONSTRAINT UniqueProdName UNIQUE (ProdName)
);

-- Create Orders table
CREATE TABLE Orders
(OrderID INTEGER,
CustomerID INTEGER NOT NULL,
EmployeeID INTEGER,
OrderDate DATE,
CONSTRAINT PKOrder PRIMARY KEY (OrderID),
CONSTRAINT FKCustomer FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID),
CONSTRAINT FKEmployee FOREIGN KEY (EmployeeID) REFERENCES Employee(EmployeeID)
);

-- Create OrderDetail table
CREATE TABLE OrderDetail
(OrderID INTEGER,
ProductID INTEGER,
Quantity DOUBLE,
CONSTRAINT PKOrderDetail PRIMARY KEY (OrderID, ProductID),
CONSTRAINT FKOrder FOREIGN KEY (OrderID) REFERENCES Orders(OrderID)
ON DELETE CASCADE 
ON UPDATE CASCADE,
CONSTRAINT FKProduct FOREIGN KEY (ProductID) REFERENCES Product(ProductID)
ON DELETE CASCADE
ON UPDATE CASCADE
);

